import React, { Component } from "react";
import CardList from "./CardList";
import SearchBox from "./SearchBox";
import { robots } from "./robots";

class App extends Component {
  constructor() {
    super()
    this.state = {
      robots: { robots },
      searchField: "",
    };
  }

  render() {
      const { robots } = this.state;
    return (
      <main>
        <header className="tc">
          <h1>Robo Friends App</h1>
          <SearchBox />
        </header>
        <section>
          <CardList robots />;
        </section>
      </main>
    );
  }
}

export default App;
